import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>header</h1>
      </header>
      <main className="App-main">
        <section>
          <h2>section</h2>
        </section>
      </main>
      <footer className="App-footer">
      </footer>
    </div>
  );
}

export default App;
